import React from 'react';

class Home extends React.Component {

  searchButtonClicked = () => {
    console.log('cliked');
  }

  searchTextChanged = (event) => {
    console.log(event.target.value);
  }

  render() {
    return(
      <div style={{padding: 20}}>

        <h1>AirGarage Homework Assignment</h1>

        <input 
          onChange={this.searchTextChanged}
          type="text"
          id="name"
          name="name"
          placeholder={"Enter Search Here"} 
          style={{height: 50, borderRadius: 5, fontSize: 18, marginRight: 15}}
        />

        <button onClick={this.searchButtonClicked}>Submit Search</button>


        <ul>
          <li>Test location</li>
        </ul>


      </div>



    );
  }
}

export default Home;
